import React from 'react';
import styled from 'styled-components';

const SideBar: React.FC = () => {
    return (
        <GridContainer>
        <Side>
             SIDEBAR
        </Side>
        <MainDisplay>
            MAINDISPLAY
        </MainDisplay>
        </GridContainer>
    )
}

export default SideBar;

const GridContainer = styled.div`
    position: fixed;
    top: 10px;
    left: 10px;
    display: grid;
    grid-template-areas:
    's s h h h h h h h h'
    's s m m m m m m m m'
    's s m m m m m m m m'
    's s m m m m m m m m'
    's s m m m m m m m m'
    's s m m m m m m m m'
    's s m m m m m m m m';
    grid-gap: 10px;
    width: 98.5%;
    height: 98%;
`;

const Side = styled.div`
    grid-area: s;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    border-radius: 30px;
    background-color: ${({ theme }) => theme.colors.black20};
`;

const MainDisplay = styled.div`
    grid-area: m;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    border-radius: 30px;
    background-color: ${({ theme }) => theme.colors.black20};
`;

const Header = styled.div`
    grid-area: h;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    border-radius: 30px;
    background-color: ${({ theme }) => theme.colors.black20};
`;
